import React from 'react';
import styled from 'styled-components';

function Header() {
	return (
		<ComponentsWrapper>
			<div className="MainBar_MainBar">
				<nav className="MainBar_MainBar_nav">
					<NavLogo>
						<button type="button">
							<img
								src="https://image.wanted.co.kr/optimize?src=https%3A%2F%2Fstatic.wanted.co.kr%2Fimages%2Ficon-menu.png&amp;w=undefined&amp;q=75"
								alt="hamberger menu"
							/>
						</button>
						<Link
							href="/"
							aria-label="home link"
							data-attribute-id="gnb"
							data-gnb-kind="home"
						>
							<i class="icon-logo_new" />
						</Link>
					</NavLogo>
					<ul>
						<li>채용</li>
					</ul>
					<aside>회원가입</aside>
				</nav>
			</div>
		</ComponentsWrapper>
	);
}

const NavLogo = styled.div`
	display: flex;
	align-items: center;
	justify-content: space-between;
	button {
		margin-top: -2px;
		margin-right: 15px;
		img {
			width: 17px;
			height: 14px;
			object-fit: contain;
		}
	}
`;

const ComponentsWrapper = styled.div`
	position: fixed;
	padding-right: initial;
	width: 100%;
	position: fixed;
	background-color: #fff;
	box-shadow: 0 1px 0 0 rgb(0 0 0 / 10%);
	z-index: 800;
	border: 1px solid black;

	.MainBar_MainBar {
		margin: 0 auto;
		height: 50px;
		width: 90%;
		position: relative;
		max-width: 1060px;
		.MainBar_MainBar_nav {
			display: flex;
			align-items: center;
			justify-content: space-between;
			flex-direction: row;
			flex-wrap: wrap;
		}
	}
`;

export default Header;
